import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import logo from "../assets/logo.png";
import "../Layout.css";

function Navbar() {
  const [mobileMenu, setMobileMenu] = useState(false);

  return (
    <nav className="navbar">
      <div className="navbar-left">
        <img src={logo} alt="Kumla Sportfiske" className="logo" />
      </div>

      <button className="hamburger" onClick={() => setMobileMenu(!mobileMenu)}>
        ☰
      </button>

      <div className={`navbar-right ${mobileMenu ? "active" : ""}`}>
        <NavLink to="/" className="navlink">Startsida</NavLink>

        {/* Regler Dropdown */}
        <div className="dropdown">
          <span className="navlink">Regler ▼</span>
          <ul className="dropdown-content">
            <li><NavLink to="/rules?lake=Lugnet">Lugnet</NavLink></li>
            <li><NavLink to="/rules?lake=Säbylundssjön">Säbylundssjön</NavLink></li>
            <li><NavLink to="/rules?lake=Nolsjön">Nolsjön</NavLink></li>
            <li><NavLink to="/clubrules">Klubbregler</NavLink></li>
          </ul>
        </div>

        {/* Kontakt Dropdown */}
        <div className="dropdown">
          <span className="navlink">Kontakt ▼</span>
          <ul className="dropdown-content">
            <li><NavLink to="/contact">Allmän kontakt</NavLink></li>
            <li><NavLink to="/inspectors">Tillsynsmän</NavLink></li>
            <li><NavLink to="/about">Om oss</NavLink></li>
          </ul>
        </div>

        <NavLink to="/news" className="navlink">Nyheter</NavLink>
        <NavLink to="/gallery" className="navlink">Galleri</NavLink>
        <a href="https://www.ifiske.se/fiske-sabylundssjon.htm" target="_blank" rel="noopener noreferrer" className="navlink">iFiske</a>
      </div>
    </nav>
  );
}

export default Navbar;
